// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
contract Auction {
address public owner ; // who deployed the contract 
address public winner ;
uint public highestBid ;
uint public endTime ;
bool public ended ;

constructor(){
    owner = msg.sender ; // the owner deploy the contract 
}
// only owner access
modifier onlyOwner (){
    require(msg.sender == owner , "Only owner can call this function");
    _;

}
function bid() public payable {
   
    require(msg.value > highestBid , "Minimum bid is $`{highestBid}`");
    require(msg.sender != owner , "Owner can't bid");
    require(block.timestamp < endTime , "Auction has ended");
    // 
    if(highestBid != 0){
        payable(winner).transfer(highestBid);
    }
    winner = msg.sender ;
    highestBid = msg.value ;
}
function endAuction() public onlyOwner {
    require(block.timestamp >= endTime , "Auction has not ended yet");
    require(!ended , "Auction already ended");
    ended = true ;
    payable(owner).transfer(address(this).balance);

}
function getWinner() public view returns(address){
    return winner ;}

}
